const canvas = document.getElementById("canvas-output");
const ctx = canvas.getContext("2d");

const image = new Image();
image.src = "data:image/jpeg;base64,";
const {width, height} = image;


canvas.width = width;
canvas.height = height;
canvas.style.width = width;
canvas.style.height = height;

let scannedImage;
let scannedData;

function getPixel(pixel) {
	const index = pixel * 4;
	return scannedData.slice(index, index + 4);
}

function setPixel(pixel, rgba) {
	const index = pixel * 4;
	scannedData[index] = rgba[0]
	scannedData[index + 1] = rgba[1];
	scannedData[index + 2] = rgba[2];
	scannedData[index + 3] = rgba[3];
}

function sumPixels(pixels) {
	let r = 0, g = 0, b = 0, a = 0;
	for (let p = 0; p < pixels.length; p++) {
		r += pixels[p][0];
		g += pixels[p][1];
		b += pixels[p][2];
		a += pixels[p][3];
	}
	return [r, g, b, a];
}

function getPixelRadius(center, radius) {
	let pixels = [];
	const centerX = center % width;
	const centerY = Math.floor(center / width);
	for (let xOffset = -radius; xOffset <= radius; xOffset++) {
		for (let yOffset = -radius; yOffset <= radius; yOffset++) {
			const sampleX = centerX + xOffset;
			const sampleY = centerY + yOffset;
			if (sampleX >= 0 && sampleX < width && sampleY >= 0 && sampleY < height) {
				const index = sampleY * width + sampleX;
				pixels.push(getPixel(index));
			} 
		}
	}
	return pixels;
}


image.addEventListener("load", function(){

	ctx.drawImage(image, 0, 0, width, height);
	
	scannedImage = ctx.getImageData(0, 0, width, height);
	scannedData = scannedImage.data;
	

	//blurImage(2, 2);


});

function blurImage(blurDepth, everySomePixels) {

	const pixels = scannedData.length / 4;

	for (let pixel = 0; pixel < Math.floor(pixels / everySomePixels); pixel += everySomePixels) {

		let radius = getPixelRadius(pixel, blurDepth);
		const numberOfPixels = radius.length;
		const [r, g, b, a] = sumPixels(radius);

		setPixel(pixel, [r / numberOfPixels, g / numberOfPixels, b / numberOfPixels, a / numberOfPixels]);


	}

	scannedImage.data = scannedData;

	ctx.putImageData(scannedImage, 0, 0);

}